export default defineConfig({
  bundler: 'esbuild',
  jsConfig: {
    input: 'index.mjs',
    output: 'index.src.js',
    outputPath: '[origin]',
  },
  cssConfig: {
    extract: true,
    input: '[origin]',
    output: '[name].src.css',
    outputPath: '/css/',
  },
  tsConfig: {
    useTs: true,
    disableTypeCheck: true,
    rt2PluginOpt: {},
  },
  reloadConfig: {
    port: 5000,
    useHMR: true,
  },
  chokidarConfig: {
    rollupInputFileGlob: 'res/**/index.mjs',
    needReloadFileGlob: ['etc/adi.conf'],
  },
  assetsConfig: {
    jspName: 'jspName',
    jspPath: 'jspPath',
    jspStrFlag: 'jspStrFlag',
    jspStrFlagAsync: 'jspStrFlagAsync',

    incName: 'incName',
    incPath: 'incPath',
    incStrFlag: 'incStrFlag',
  },
  alias: { '@': 'res/js' },
  eol: {
    flag: 'lf',
    fileRegex: /\\.src\\.(css|js)$/,
  },
});
